    false,nt"url": null,nt"notes": "In situ, navigational, physical and profile
    oceanographic data were collected, including DEPTH - OBSERVATION, HYDROSTATIC PRESSURE,
    LATITUDE, LONGITUDE and WATER TEMPERATURE from at the Meridional Overturning Variability
    Experiment (MOVE7) using inverted echo sounder (IES) and pressure sensors from 2004-03-06
    to 2009-02-13. These data were provided to one of the OceanSITES Data Assembly Centers
    (DAC). The DAC formatted this information into the OceanSITES file format and passed
    it on to the Global Data Assembly Centers (GDAC).nnOceanSITES is a worldwide system
    of long-term, open-ocean reference stations measuring dozens of variables and monitoring
    the full depth of the ocean from air-sea interactions down to the seafloor. It is
    a network of stations or observatories measuring many aspects of the ocean's surface
    and water column using, where possible, automated systems with advanced sensors
    and telecommunications systems, yielding high time resolution, often in real-time,
    while building a long record.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
